    true,nt"url": null,nt"notes": "The NOAA WP-3D Orion aircraft collects numerous
    in-situ meteorological measurements along with navigation and aircraft state parameters
    during each flight (these data are similar to that collected with the NASA DC-8
    ICATS  system). The WP-3D data are encoded on 8mm tape in what is called the 'AOC
    Standard Tape Format'. Examples of meteorological data include total temperature,
    dew point, liquid water content and dynamic pressure (from several sensors). Aircraft
    parameters include angle of attack, airspeed, slip angle, etc.",nt"license_title":
